<script src="https://cdn.jsdelivr.net/npm/warpjs@1.0.8/dist/warp.js"></script>

<script>

function warpme(inp,outp,warpb){
	in_points = inp
	out_point_diffs = outp
	warp_bound = warpb
	
	const svg = document.getElementById('svg-element')
	const warp = new Warp(svg)

	// https://franciscohodge.com/2018/01/14/find-closest-element-click-coordinates-javascript-coding-question/
	function d ([x, y]){
		let dx = 0
		let dy = 0
		let den = 0

		in_points.forEach(function (linkCoord,i) {
			let distance = Math.hypot(linkCoord[0]-x, linkCoord[1]-y);
			if (distance < warp_bound[i]){
				dx = dx + (1-distance/warp_bound[i])*out_point_diffs[i][0]
				dy = dy + (1-distance/warp_bound[i])*out_point_diffs[i][1]
				den = den + 1
			}
		});
		if (den==0){
			return [x,y]
		}
		return [x+dx/den,y+dy/den];

	}


	warp.interpolate(4)
	warp.transform(d)
}

function clicked(evt){
    var e = evt.target;
    var dim = e.getBoundingClientRect();
    var svg = document.getElementById('svg-element'),
		pt = svg.createSVGPoint();

	pt.x = evt.clientX;
	pt.y = evt.clientY;
	var svgP = pt.matrixTransform(svg.getScreenCTM().inverse());
	warpme([[svgP.x,svgP.y]],[[10,10]],[50])
}  
</script>
